body:
# Overview

The endpoints described on this page provide access to information from the Core chain (layer 1).
[block:callout]
{
  "type": "warning",
  "title": "gRPC Migration",
  "body": "The remaining JSON-RPC endpoints will be migrated to gRPC in a future release"
}
[/block]
## Required Parameters
All valid JSON-RPC requests require the inclusion the parameters listed in the following table.

| Name | Type | Description |
| - | - | - |
| `method` | String | Name of the endpoint |
| `id` | Integer | Request id (returned in the response to differentiate results from the same endpoint) |
| `jsonrpc` | String | JSON-RPC version ("2.0") |

Additional information may be found in the [JSON-RPC 2.0 specification](https://www.jsonrpc.org/specification#request_object).

# Endpoint Details

## getBestBlockHash

**Returns**: the block hash of the chaintip
**Parameters**: none

### Example Request and Response
[block:code]
{
  "codes": [
    {
      "code": "curl --request POST \
  --url http://seed-1.testnet.networks.dash.org:3000/ \
  --header 'content-type: application/json' \
  --data '{
      "method":"getBestBlockHash",
      "id":1,
      "jsonrpc":"2.0",
      "params":{}
    }'",
      "language": "curl",
      "name": "Curl"
    },
    {
      "code": "var request = require("request");

var options = {
  method: 'POST',
  url: 'http://seed-1.testnet.networks.dash.org:3000',
  headers: {'content-type': 'application/json'},
  body: '{"method":"getBestBlockHash","id":1,"jsonrpc":"2.0"}'
};

request(options, function (error, response, body) {
  if (error) throw new Error(error);

  console.log(body);
});",
      "language": "javascript"
    },
    {
      "code": "var XMLHttpRequest = require('xhr2');
var data = '{"method":"getBestBlockHash","id":1,"jsonrpc":"2.0"}';

var xhr = new XMLHttpRequest();

xhr.addEventListener("readystatechange", function () {
  if (this.readyState === this.DONE) {
    console.log(this.responseText);
  }
});

xhr.open("POST", "http://seed-1.testnet.networks.dash.org:3000");
xhr.setRequestHeader("content-type", "application/json");

xhr.send(data);",
      "language": "javascript",
      "name": "Node"
    },
    {
      "code": "import requests
import json

url = "http://seed-1.testnet.networks.dash.org:3000/"
headers = {'content-type': 'application/json'}

payload_json = {
    "method": "getBestBlockHash",
    "id": 1,
    "jsonrpc": "2.0",
    "params": {}
}

response = requests.request("POST", url, data=json.dumps(payload_json), headers=headers)

print(response.text)",
      "language": "python"
    },
    {
      "code": "require 'uri'
require 'net/http'

url = URI("http://seed-1.testnet.networks.dash.org:3000/")
http = Net::HTTP.new(url.host, url.port)

request = Net::HTTP::Post.new(url)
request["content-type"] = 'application/json'

request.body = '{
    "method":"getBestBlockHash",
    "id":1,
    "jsonrpc":"2.0",
    "params":{ }
}'

response = http.request(request)
puts response.read_body",
      "language": "ruby"
    }
  ]
}
[/block]

