## getMnListDiff

**Returns**: a masternode list diff for the provided block hashes
**Parameters**:

| Name | Type | Required | Description |
| - | - | - | - |
| `baseBlockHash` | String | Yes | Block hash for the starting block |
| `blockHash` | String | Yes | Block hash for the ending block |

### Example Request and Response
[block:code]
{
  "codes": [
    {
      "code": "curl --request POST \
  --url http://seed-1.testnet.networks.dash.org:3000/ \
  --header 'content-type: application/json' \
  --data '{
      "method":"getMnListDiff",
      "id":1,
      "jsonrpc":"2.0",
      "params": {
        "baseBlockHash": "6c2f69e9696baf3c28af0d21d85af0e61c6a2adbe319c3714ec4b16adc3e1d2f",
        "blockHash": "000000bbdda70535d4fa854ca8c12d67f5788bcc6f7d85d39722bc2abed10f58"
      }
    }'",
      "language": "shell",
      "name": "Curl"
    },
    {
      "code": "import requests
import json

url = "http://seed-1.testnet.networks.dash.org:3000/"
headers = {'content-type': 'application/json'}

payload_json = {
    "method":"getMnListDiff",
    "id":1,
    "jsonrpc":"2.0",
    "params": {
        "baseBlockHash": "0000248ff415f1a3155b30c4041bdb681c25a69a319b83676f878d8214441e0b",
        "blockHash": "000001c61729f702adae5266adf68f378211a5ea33970683724894f0e1bae56d"
    }
}  

response = requests.request("POST", url, data=json.dumps(payload_json), headers=headers)

print(response.text)",
      "language": "python"
    },
    {
      "code": "require 'uri'
require 'net/http'

url = URI("http://seed-1.testnet.networks.dash.org:3000/")
http = Net::HTTP.new(url.host, url.port)

request = Net::HTTP::Post.new(url)
request["content-type"] = 'application/json'

request.body = '{
    "method":"getMnListDiff",
    "id":1,
    "jsonrpc":"2.0",
    "params": {
        "baseBlockHash": "0000248ff415f1a3155b30c4041bdb681c25a69a319b83676f878d8214441e0b",
        "blockHash": "000001c61729f702adae5266adf68f378211a5ea33970683724894f0e1bae56d"
    }
}'

response = http.request(request)
puts response.read_body",
      "language": "ruby"
    }
  ]
}
[/block]

